export default function Login() {
  return(
    <Router>
      <div>
          <li>
            <Link  to="/LoginRedirect">Welcome Back</Link>
          </li>
      </div>
      <Switch>
        <Route path="/LoginRedirect">
          <LoginRedirect/>
        </Route>
      </Switch>
    </Router>
  )
}
